_2=\"homepage1/consulting.png\" title_3=\"Cognitive Solution\" subtitle_3=\"One make creepeth, man bearing theira firmament.\" image_3=\"homepage1/cognity.png\" ][/how-it-works]</div><div>[testimonials title=\"Why Our Team Is One Of The Best!\" subtitle=\"There are countless great reasons to work at our company and we hate to brag, but it’s too hard not to!\" highlight=\"Built Exclusively For You\" link=\"/\" style=\"style-4\"][/testimonials]</div><div>[our-news title=\"From Our Blog\" subtitle=\"From Our blog and Event fanpage\" number_of_displays=\"6\"][/our-news]</div><div>[newsletter name=\"newsletter\" title=\"Subscribe our newsletter\" subtitle=\"By clicking the button, you are agreeing with our Term & Conditions\" link=\"/\" text_link=\"Term & Conditions\" image=\"general/img-newsletter.png\" mini_image=\"general/chart.png\"][/newsletter]</div>',1,NULL,'default',NULL,'published','2022-11-03 19:35:05','2022-11-03 19:35:05'),(20,'Senior Full Stack Engineer, Creator Success Full Time','<div class=\"row\">\n    <div class=\"col-lg-10 mx-auto\">\n        <h2 class=\"text-heading-4\">Job Description</h2>\n        <p class=\"text-body-text\">The AliStudio Design team has a vision to establish a trusted platform\n            that enables productive and healthy enterprises in a world of digital and remote everything,\n            constantly changing work patterns and norms, and the need for organizational resiliency.</p>\n        <p class=\"text-body-text\">The ideal candidate will have strong creative skills and a portfolio of\n            work which demonstrates their passion for illustrative design and typography. This candidate\n            will have experiences in working with numerous different design platforms such as digital and\n            print forms.</p>\n        <p></p>\n        <div>\n            [youtube-video image=\"general/career-img.png\" with_container=\"no\"]https://www.youtube.com/watch?v=SlPhMPnQ58k[/youtube-video]\n        </div>\n\n        <h2 class=\"text-heading-4\">Essential Knowledge, Skills, and Experience</h2>\n        <ul>\n            <li>A portfolio demonstrating well thought through and polished end to end customer journeys\n            </li>\n            <li>5+ years of industry experience in interactive design and / or visual design</li>\n            <li>Excellent interpersonal skills&#x202F;</li>\n            <li>Aware of trends in&#x202F;mobile, communications, and collaboration</li>\n            <li>Ability to create highly polished design prototypes, mockups, and other communication\n                artifacts</li>\n            <li>The ability to scope and estimate efforts accurately and prioritize tasks and goals\n                independently</li>\n            <li>History of impacting shipping products with your work</li>\n            <li>A Bachelor&rsquo;s Degree in Design (or related field) or equivalent professional experience\n            </li>\n            <li>Proficiency in a variety of design tools such as Figma, Photoshop, Illustrator, and Sketch\n            </li>\n        </ul>\n        <p></p>\n        <h2 class=\"text-heading-4\">Essential Knowledge, Skills, and Experience</h2>\n        <ul>\n            <li>Designing user experiences for enterprise software / services</li>\n            <li>Creating and applying established design principles and interaction patterns</li>\n            <li>Aligning or influencing design thinking with teams working in other geographies</li>\n        </ul>\n        <p></p>\n        <h2 class=\"text-heading-4\">Essential Knowledge, Skills, and Experience</h2>\n        <p>Product knowledge: Deeply understand the technology and features of the product area to which you\n            are assigned.</p>\n        <p>Research : Provide human and business impact and insights for products.</p>\n        <p>Deliverables: Create deliverables for your product area (for example competitive analyses, user\n            flows, low fidelity wireframes, high fidelity mockups, prototypes, etc.) that solve real user\n            problems through the user experience.</p>\n        <p>Communication: Communicate the results of UX activities within your product area to the design\n            team department, cross-functional partners within your product area, and other interested\n            Superformula team members using clear language that simplifies complexity.</p>\n        <div class=\"border-bottom mt-50 mb-50\"></div>\n        <div>\n            [apply-now primary_url=\"/\" primary_title=\"Apply now\" secondary_url=\"/contact\" secondary_title=\"Contact\"][/apply-now]\n        </div>        \n    </div>\n</div>\n<div>\n    [newsletter name=\"newsletter\" title=\"Subscribe our newsletter\" subtitle=\"By clicking the button, you are agreeing with our Term & Conditions\" link=\"/\" text_link=\"Term & Conditions\" image=\"general/img-newsletter.png\" mini_image=\"general/chart.png\"][/newsletter]\n</div>\n',1,NULL,'page-detail',NULL,'published','2022-11-03 19:35:05','2022-11-03 19:35:05'),(21,'About Us 2','<div>[hero-banner title=\"Start Your Dream Business Today\" highlight_text=\"What We Do, What You Get\" subtitle=\"Integrated workflow designed for product teams. We create world-class development and branding\" image=\"general/banner7.png\" bg_color=\"#990099\" primary_title=\"Join Our Team\" primary_url=\"/\" secondary_title=\"Contact Us\" secondary_url=\"/\" style=\"style-7\" quantity=\"3\"  title_1=\"Projects done\" count_1=\"12\" extra_1=\"k\" image_1=\"general/icon-project-done.png\" title_2=\"Offices / Factories\" count_2=\"28\" extra_2=\"k\" image_2=\"general/icon-officer.png\" title_3=\"Constant clients\" count_3=\"15\" extra_3=\"k\" image_3=\"general/icon-constant.png\"][/hero-banner]</div><div>[how-it-works title=\"How It Works\" subtitle=\"Elevate your Employee Development Journey\" style=\"style-4\" quantity=\"5\" title_1=\"Start Plan\" subtitle_1=\"Choose any of our packages\" image_1=\"general/icon-start-plan.png